int maxUpto(int lineNumber, int endPoint)
{
  if (pop(0, lineNumber, endPoint) != 0)
    return pop(0, lineNumber, endPoint);

  int i;
  if (lineNumber == 0)
  {
    push(0, 0, 0, pop(1, 0, 0));
    return pop(0, 0, 0);
  }

  if (endPoint == 0)
  {
    push(0, lineNumber, 0, pop(1, lineNumber, 0) + maxUpto(lineNumber - 1, 0));
    return pop(0, lineNumber, 0);
  }

  if (endPoint <= (lineNumber - 1))
  {
    int a = maxUpto(lineNumber - 1, endPoint - 1);
    int b = maxUpto(lineNumber - 1, endPoint);
    int c = pop(1, lineNumber, endPoint);
    if ((a + c) > (b + c))
    {
      push(0, lineNumber, endPoint, a + c);
      return a + c;
    }
    else
    {
      push(0, lineNumber, endPoint, b + c);
      return b + c;
    }

  }

  if (endPoint == lineNumber)
  {
    push(0, lineNumber, lineNumber, maxUpto(lineNumber - 1, lineNumber - 1) + pop(1, lineNumber, lineNumber));
    return maxUpto(lineNumber - 1, lineNumber - 1) + pop(1, lineNumber, lineNumber);
  }

