unsigned int gcd(unsigned int a, unsigned int b)
{
  if (a == 0)
    return b;

  if (b == 0)
    return a;

  int shift = __builtin_ctz(a | b);
  a >>= __builtin_ctz(a);
  do
  {
    b >>= __builtin_ctz(b);
    if (a > b)
    {
      a += b;
      b = a - b;
      a = a - b;
    }

    b -= a;
  }
  while (b);
  return a << shift;
}

