{
  long int i = 0;
  long int j = 1;
  long int minimum = min(arr[0], arr[1]);
  if ((len % 2) == 0)
  {
    for (; (i < len) && (j < len); i += 2, j += 2)
    {
      long int temp = min(arr[i], arr[j]);
      if (temp < minimum)
      {
        minimum = temp;
      }

    }

  }

  if ((len % 2) != 0)
  {
    for (; (i < len) && (j < len); i += 2, j += 2)
    {
      long int temp = min(arr[i], arr[j]);
      if (temp < minimum)
      {
        minimum = temp;
      }

      minimum = min(minimum, arr[len - 1]);
    }

  }

  return minimum * (len - 1);
}

