int *tree;
int levels = 0;
int treeSize(int levels)
{
  return (levels * (levels + 1)) / 2;
}

int findBranch(int level, int pos)
{
  return treeSize(level) + pos;
}

int findBiggestSum(int level, int pos)
{
  int c = tree[findBranch(level, pos)];
  if (level == (levels - 1))
    return c;

  if (level == (levels - 2))
  {
    return c + ((tree[findBranch(level + 1, pos)] > tree[findBranch(level + 1, pos + 1)]) ? (tree[findBranch(level + 1, pos)]) : (tree[findBranch(level + 1, pos + 1)]));
  }

  return c + ((findBiggestSum(level + 1, pos) > findBiggestSum(level + 1, pos + 1)) ? (findBiggestSum(level + 1, pos)) : (findBiggestSum(level + 1, pos + 1)));
}

