long long dope(int tri[][200], int x, int y, int weed[][200])
{
  if (weed[x][y] != 0)
    return weed[x][y];

  if (x == 0)
    return weed[x][y] = tri[x][y];

  if (y == 0)
    return weed[x][y] = tri[x][y] + dope(tri, x - 1, y, weed);

  int p;
  int q;
  int r;
  r = (tri[x - 1][y] > tri[x - 1][y - 1]) ? (1) : (2);
  if (r == 1)
  {
    p = x - 1;
    q = y;
  }

  if (r == 2)
  {
    p = x - 1;
    q = y - 1;
  }

  return weed[x][y] = tri[x][y] + dope(tri, p, q, weed);
}

