int solve(int p, int q)
{
  int sum1 = num_collec[p][q];
  int sum2 = num_collec[p][q];
  if (memo[p][q] != (-1))
  {
    return memo[p][q];
  }

  if (p == height)
  {
    return 0;
  }
  else
  {
    sum1 = sum1 + solve(p + 1, q);
    sum2 = sum2 + solve(p + 1, q + 1);
  }

  if (sum1 > sum2)
  {
    memo[p][q] = sum1;
    return sum1;
  }
  else
  {
    memo[p][q] = sum2;
    return sum2;
  }

}

